package Operators;

public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int x = 10;
		int y = 20;
		
		boolean Results = x == y;
		System.out.println("X == Y is: "+ Results);
		
		
		Results = x != y;
		System.out.println("X != Y is: "+ Results);
		
		Results = x > y;
		System.out.println("X > Y is: "+ Results);
		
	
		Results = x >= y;
		System.out.println("X >= Y is: "+ Results);
		
		Results = x < y;
		System.out.println("X < Y is: "+ Results);
		
		
		Results = x <= y;
		System.out.println("X <= Y is: "+ Results);
		
	}

}
